      const geoUrl = `${this.geoUrl}/city/lookup?location=${location}&key=${this.apiKey}`;
      console.log('正在获取城市信息...');

      const geoResponse = await fetch(geoUrl);
      const geoText = await geoResponse.text(); // 先获取文本响应
