      try {
        geoData = JSON.parse(geoText);
      } catch (e) {
        console.error('解析城市信息响应失败:', e);
        return this.getDefaultWeather();
      }

      if (geoData.code !== '200') {
        console.error('获取城市信息失败:', geoData);
        // 使用经纬度直接查询天气
        return this.getWeatherByLocation(location);
      }

      // 使用获取到的城市ID
