    try {
      const weatherUrl = `${this.baseUrl}/weather/now?location=${location}&key=${this.apiKey}`;
      console.log('正在获取天气信息...');

      const weatherResponse = await fetch(weatherUrl);
      const weatherText = await weatherResponse.text(); // 先获取文本响应
      console.log('天气信息原始响应:', weatherText);

