    // 根据天气状况添加特定建议
    if (description.includes('雨')) {
      suggestion += ' 记得带伞！☔';
    } else if (description.includes('晴')) {
      suggestion += ' 防晒要做好！🧴';
    }

    return `${cityName}现在气温${temperature}°C，${description}。${suggestion}`;
